import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import QuizApp from "./components/QuizApp";
import ResultsCard from "./components/ResultCard"; 
import QuestionCard from "./components/QuestionCard";
import Login from "./components/Login";       
import Signup from "./components/Signup";  
import Navbar from "./components/Navbar";


import "./App.css";

export default function App() {
  return (
    <Router>
      <div className="App">
        
        <h1 className="title">Aptitude Challenge</h1>
        <Routes>
            <Route path="/" element={<QuizApp />} />
            <Route path="/login" element={<Login />} />
            <Route path="/signup" element={<Signup />} />
            <Route path="/results" element={<ResultsCard />} />
            <Route path="/question" element={<QuestionCard />} />
            <Route path="/profile" element={<Profile />} />
            <Route path="/settings" element={<Settings />} />
            <Route path="/past-quizzes" element={<PastQuizzes />} />
            <Route path="/upcoming-quizzes" element={<UpcomingQuizzes />} />
            <Route path="*" element={<h2>Page Not Found</h2>} />
            <Route path="/navbar" element={<Navbar />} />
        </Routes>
      </div>
    </Router>
  );
}
